import React from 'react';


const Card = (props) => {
	const {name, date} = props;
	return (
		<div className = 'tc bg-light-green dib br3 pa3 ma2 grow bw2 shadow-5'>
			<div className = "flex">
					<h2> {name} </h2>
					<p>  {date} </p>

			</div>
		</div>
	);
}

export default Card;
